import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import { Button, Typography } from '@material-ui/core';
import $ from 'jquery';
import './navbar.css';

/**
 * Navbar Class
 * In case I want to cry over muicss dropdowns instead of my own, better-behaved
 * implementation: https://www.muicss.com/docs/v1/react/dropdowns
 * Or Boostrap's dropdown, even tho I'm using MUI framework:
 * https://react-bootstrap.github.io/components/dropdowns/
 */
class Navbar extends Component {
  /**
   * Navigate to selected page
   * @param {string} page path of the page to navigate to
   */
  navigateTo(page) {
    window.location.href = page;
  }

  componentDidMount() {
    // window.addEventListener('hashchange', this.doSomething, false);
    let x = $('.navbar-secondary')
    console.log(x)
  }

  componentWillUnmount() {
    // window.removeEventListener('hashchange', this.doSomething, false);
  }

  /**
   * .
   */
  onMouseLeave(e) {
    console.log('wazzuuup', e);
    // if (e.toE)
  }

  /**
   * Opens the dropdown for a menu item
   * @param {React.element} ul html list of dropdown items
   */
  openDropdown(ul) {
    ReactDOM.render(ul, document.getElementById('navbar-secondary'));
    // let elems = $('.navbar-dropdown');
    // console.log('ENTERED', elems);
    // elems.each((idx) => {
    //   console.log(elems[idx]);
    //   elems[idx].removeEventListener('mouseleave', this.onMouseLeave);
    //   elems[idx].addEventListener('mouseleave', (e) => this.onMouseLeave(e));
    // });
  }

  /**
   * Render the Navbar component
   */
  render() {
    let linksUL = (
      <ul className="navbar-dropdown mui-dropdown__menu mui--is-open" style={{top: '39.5px'}}>
        <li style={{backgroundColor: 'indianred'}}><a href="links.html">My Links</a></li>
        <li style={{backgroundColor: 'indianred'}}><a href="links.html">BLM Links</a></li>
      </ul>
    );

    let fakeUL = (
      <ul className="navbar-dropdown mui-dropdown__menu mui--is-open" style={{top: '39.5px'}}>
        <li style={{backgroundColor: 'indianred'}}><a href="links.html">Fake 1</a></li>
        <li style={{backgroundColor: 'indianred'}}><a href="links.html">Fake 2</a></li>
      </ul>
    );

    return (
      <div id="navbar-container">
        <div id="navbar-title-container">
          <Typography id="navbar-title" variant="h2">
            NATALIE WAGNER
          </Typography>
        </div>
        <div id="navbar-buttons-container">
          <Button color="inherit" onClick={() => this.navigateTo('index.html')}>
            Home
          </Button>

          {/* put links HERE instead */}

          <Button color="inherit" onClick={() => this.navigateTo('emailnatalie.html')}>
            Email Me
          </Button>

          {/* break */}

          <Button color="inherit" className="navbar-dropdown"
            onMouseEnter={() => this.openDropdown(linksUL)}>
            Links
          </Button>

          <Button color="inherit" className="navbar-dropdown"
            onMouseEnter={() => this.openDropdown(fakeUL)}>
            Fake
          </Button>

          <div id="navbar-secondary"
            className="mui-dropdown MuiButtonBase-root MuiButton-root MuiButton-text MuiButton-colorInherit"
            style={{display: 'inline', borderWidth: '0px'}}>
          </div>
        </div>
      </div>
    );
  }
}

export default Navbar;
